import React from "react";
import {
  Route,
  Routes,
  NavLink,
  BrowserRouter
} from "react-router-dom";
import Navbar from "./components/Navbar/index";



export default function BasicExample() {
  return (
    <BrowserRouter>
      <div>

        <Navbar />

        <Routes>
          <Route exact path="/" element={<Home />} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}



function Home() {
  return (
    <div>
      <h2>Home</h2>
    </div>
  );
}
